DROP TABLE IF EXISTS `wp_icl_translate`;
CREATE TABLE IF NOT EXISTS `wp_icl_translate` (  `tid` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `job_id` bigint(20) unsigned NOT NULL,  `content_id` bigint(20) unsigned NOT NULL,  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),  `field_type` varchar(160) NOT NULL,  `field_format` varchar(16) NOT NULL,  `field_translate` tinyint(4) NOT NULL,  `field_data` longtext NOT NULL,  `field_data_translated` longtext NOT NULL,  `field_finished` tinyint(4) NOT NULL DEFAULT 0,  PRIMARY KEY (`tid`),  KEY `job_id` (`job_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_icl_translate_job`;
CREATE TABLE IF NOT EXISTS `wp_icl_translate_job` (  `job_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `rid` bigint(20) unsigned NOT NULL,  `translator_id` int(10) unsigned NOT NULL,  `translated` tinyint(3) unsigned NOT NULL DEFAULT 0,  `manager_id` int(10) unsigned NOT NULL,  `revision` int(10) unsigned DEFAULT NULL,  `title` varchar(160) DEFAULT NULL,  `deadline_date` datetime DEFAULT NULL,  `completed_date` datetime DEFAULT NULL,  PRIMARY KEY (`job_id`),  KEY `rid` (`rid`,`translator_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_icl_translation_batches`;
CREATE TABLE IF NOT EXISTS `wp_icl_translation_batches` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `batch_name` text NOT NULL,  `tp_id` int(11) DEFAULT NULL,  `ts_url` text DEFAULT NULL,  `last_update` datetime DEFAULT NULL,  PRIMARY KEY (`id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_icl_translation_status`;
CREATE TABLE IF NOT EXISTS `wp_icl_translation_status` (  `rid` bigint(20) NOT NULL AUTO_INCREMENT,  `translation_id` bigint(20) NOT NULL,  `status` tinyint(4) NOT NULL,  `translator_id` bigint(20) NOT NULL,  `needs_update` tinyint(4) NOT NULL,  `md5` varchar(32) NOT NULL,  `translation_service` varchar(16) NOT NULL,  `batch_id` int(11) NOT NULL DEFAULT 0,  `translation_package` longtext NOT NULL,  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),  `links_fixed` tinyint(4) NOT NULL DEFAULT 0,  `_prevstate` longtext DEFAULT NULL,  `uuid` varchar(36) DEFAULT NULL,  PRIMARY KEY (`rid`),  UNIQUE KEY `translation_id` (`translation_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_icl_translations`;
CREATE TABLE IF NOT EXISTS `wp_icl_translations` (  `translation_id` bigint(20) NOT NULL AUTO_INCREMENT,  `element_type` varchar(60) NOT NULL DEFAULT 'post_post',  `element_id` bigint(20) DEFAULT NULL,  `trid` bigint(20) NOT NULL,  `language_code` varchar(7) NOT NULL,  `source_language_code` varchar(7) DEFAULT NULL,  PRIMARY KEY (`translation_id`),  UNIQUE KEY `trid_lang` (`trid`,`language_code`),  UNIQUE KEY `el_type_id` (`element_type`,`element_id`),  KEY `trid` (`trid`),  KEY `id_type_language` (`element_id`,`element_type`,`language_code`)) ENGINE=MyISAM AUTO_INCREMENT=956 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_links`;
CREATE TABLE IF NOT EXISTS `wp_links` (  `link_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `link_url` varchar(255) NOT NULL DEFAULT '',  `link_name` varchar(255) NOT NULL DEFAULT '',  `link_image` varchar(255) NOT NULL DEFAULT '',  `link_target` varchar(25) NOT NULL DEFAULT '',  `link_description` varchar(255) NOT NULL DEFAULT '',  `link_visible` varchar(20) NOT NULL DEFAULT 'Y',  `link_owner` bigint(20) unsigned NOT NULL DEFAULT 1,  `link_rating` int(11) NOT NULL DEFAULT 0,  `link_updated` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',  `link_rel` varchar(255) NOT NULL DEFAULT '',  `link_notes` mediumtext NOT NULL,  `link_rss` varchar(255) NOT NULL DEFAULT '',  PRIMARY KEY (`link_id`),  KEY `link_visible` (`link_visible`)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_options`;
CREATE TABLE IF NOT EXISTS `wp_options` (  `option_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `option_name` varchar(191) NOT NULL DEFAULT '',  `option_value` longtext NOT NULL,  `autoload` varchar(20) NOT NULL DEFAULT 'yes',  PRIMARY KEY (`option_id`),  UNIQUE KEY `option_name` (`option_name`),  KEY `autoload` (`autoload`)) ENGINE=InnoDB AUTO_INCREMENT=522 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
